desc:
Pull dropped {@link net.minecraft.entity.item.EntityItem EntityItem}s from the world above the hopper and items from any inventory attached to this hopper into the hopper's inventory.

@param hopper the hopper in question
@return whether any items were successfully added to the hopper

Parses a JSON string into a {@link ITextComponent}, with strict parsing.

@see #fromJsonLenient(String)
@see {@link com.google.gson.stream.JsonReader#setLenient(boolean)}

Returns whether this player can modify the block at a certain location with the given stack.
<p>
The position being queried is {@code pos.offset(facing.getOpposite()))}.

@return Whether this player may modify the queried location in the current world
@see ItemStack#canPlaceOn(Block)
@see ItemStack#canEditBlocks()
@see PlayerCapabilities#allowEdit

Writes this entity to NBT, unless it has been removed. Also writes this entity's passengers, and the entity type ID (so the produced NBT is sufficient to recreate the entity).

Generally, {@link #writeUnlessPassenger} or {@link #writeWithoutTypeId} should be used instead of this method.

@return True if the entity was written (and the passed compound should be saved); false if the entity was not written.

Parses a JSON string into a {@link ITextComponent}, being lenient upon parse errors.

@see #jsonToComponent(String)
@see {@link com.google.gson.stream.JsonReader#setLenient(boolean)}

Creates an Iterable that returns all positions in the box specified by the given corners. <strong>Coordinates must be in order</strong>; e.g. x1 <= x2.

This method uses {@link BlockPos.MutableBlockPos MutableBlockPos} instead of regular BlockPos, which grants better performance. However, the resulting BlockPos instances can only be used inside the iteration loop (as otherwise the value will change), unless {@link #toImmutable()} is called. This method is ideal for searching large areas and only storing a few locations.

@see #getAllInBox(BlockPos, BlockPos)
@see #getAllInBox(int, int, int, int, int, int)
@see #getAllInBoxMutable(BlockPos, BlockPos)

Get the children of this {@code Advancement}.

@return an {@code Iterable} of this {@code Advancement}'s children.
@see #getParent()

Get the {@link Criterion Criteria} used to decide the completion of this {@code Advancement}. Each key-value pair consists of a {@code Criterion} and its name.

@return the criteria used to decide the completion of this {@code Advancement}
@see #getRequirements()

Read criteria from {@code buf}.

@return the read criteria. Each key-value pair consists of a {@code Criterion} and its name.
@see #serializeToNetwork(Map, PacketBuffer)

Read criteria from {@code json}. The keys of the object name the criteria, and the values (which must be objects) are the criteria themselves.

@return the deserialized criteria. Each key-value pair consists of a {@code Criterion} and its name.
@see #criterionFromJson(JsonObject, JsonDeserializationContext)

Deserialize a <em>single</em> {@code Criterion} from {@code json}. The {@link ICriterionTrigger} is chosen by the {@code "trigger"} property of the object, which can then handle the optional {@code "conditions"} in the object. The {@code "conditions"}, if present, must be a {@code JsonObject}. The resulting {@link ICriterionInstance} is wrapped in a {@code Criterion}.

@return the deserialized {@code Criterion}.
@see ICriterionTrigger#deserializeInstance(JsonObject, JsonDeserializationContext)

Get how many requirements this {@code Advancement} has.

@return {@code this.getRequirements().length}
@see #getRequirements()

Will be called when the cursor is moved.

<p>The callback function receives the cursor position, measured in screen coordinates but relative to the top-left corner of the window client area. On platforms that provide it, the full sub-pixel cursor position is passed on.</p>

@see GLFWCursorPosCallbackI

